        return (
            <>
           {
               Moviename.map( (item)=>{
                  return (
                      <>
                      <h1>{item.name}</h1>
                      <b> ${item.price}</b>
                      </>
                  )  
               })
           }
           <img src="img/car.jpg" style={{width:"200px",height:"200px"}}/>
            </>
        )
  }

export default MovieList;
